item.description:
Необходимо в сжатые сроки (3-5 дней) выполнить раздел КР индивидуального жилого дома . Раздел АР есть , файл архикад есть . Дом 2-х этажный . Но КР НАДО ТОЛЬКО НА ВТОРОЙ ЭТАЖ И КРЫШУ (стены - Газоблок , крыша - деревянная стропильная , с мягко черепицей ). 
1. Проектирование наружных  стен с учётом утепления (для г. Владивосток )+ навесной фасад (Ханья ) 
2. Проектирование отмостки/тротуара / крыльца 
3. Проектирование узла разгрузочного пояса для крепления мауэрлата;
4. Проектирование крыши  узлы , план стропил, финишное
покрытие битумная черепица «Тегола»), согласно приложенных эскизов;
6. Проектирование организации сбора воды с кровли;
7. Проектирование конструкции внутренней лестницы (деревянная) + узлы сопряжения с полом 1 и 2 этаж 
8. Проектирование ограждений крыльцев наружных
отчетность по исполнению работ каждый день
